SET NAMES utf8mb4;
SET FOREIGN_KEY_CHECKS=0;
START TRANSACTION;

DROP TABLE IF EXISTS vehicle_style_year;
DROP TABLE IF EXISTS vehicle_style;
DROP TABLE IF EXISTS vehicle_model_year;
DROP TABLE IF EXISTS vehicle_model;
DROP TABLE IF EXISTS vehicle_make;

CREATE TABLE IF NOT EXISTS vehicle_make (
  make_id INT NOT NULL,
  make_slug VARCHAR(64) NOT NULL,
  make_name VARCHAR(128) NOT NULL,
  first_year SMALLINT NULL,
  last_year SMALLINT NULL,
  PRIMARY KEY (make_id),
  UNIQUE KEY uk_vehicle_make_slug (make_slug),
  KEY idx_vehicle_make_name (make_name)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

CREATE TABLE IF NOT EXISTS vehicle_model (
  model_id INT NOT NULL,
  make_id INT NOT NULL,
  model_name VARCHAR(128) NOT NULL,
  PRIMARY KEY (model_id),
  UNIQUE KEY uk_vehicle_model_make_name (make_id, model_name),
  KEY idx_vehicle_model_name (model_name),
  CONSTRAINT fk_vehicle_model_make FOREIGN KEY (make_id) REFERENCES vehicle_make(make_id)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

CREATE TABLE IF NOT EXISTS vehicle_model_year (
  model_id INT NOT NULL,
  year SMALLINT NOT NULL,
  PRIMARY KEY (model_id, year),
  KEY idx_vehicle_model_year_year (year),
  CONSTRAINT fk_vehicle_model_year_model FOREIGN KEY (model_id) REFERENCES vehicle_model(model_id)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

CREATE TABLE IF NOT EXISTS vehicle_style (
  style_id INT NOT NULL,
  make_id INT NOT NULL,
  model_id INT NOT NULL,
  style_name VARCHAR(255) NOT NULL,
  style_info_json JSON NOT NULL,
  PRIMARY KEY (style_id),
  UNIQUE KEY uk_vehicle_style_make_model_name (make_id, model_id, style_name(191)),
  KEY idx_vehicle_style_name (style_name),
  CONSTRAINT fk_vehicle_style_make FOREIGN KEY (make_id) REFERENCES vehicle_make(make_id),
  CONSTRAINT fk_vehicle_style_model FOREIGN KEY (model_id) REFERENCES vehicle_model(model_id)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

CREATE TABLE IF NOT EXISTS vehicle_style_year (
  style_id INT NOT NULL,
  year SMALLINT NOT NULL,
  PRIMARY KEY (style_id, year),
  KEY idx_vehicle_style_year_year (year),
  CONSTRAINT fk_vehicle_style_year_style FOREIGN KEY (style_id) REFERENCES vehicle_style(style_id)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;






COMMIT;
SET FOREIGN_KEY_CHECKS=1;
